import { useContext } from "react";
import { Outlet } from "react-router-dom";
import { CartContext } from "./contexts/CartContext";
import { Header, HeaderLinks, HeaderP } from "./styled/StyledAppHeader";
import { Link } from "react-router-dom";

const AppHeader = (props) => {
    const { productCart } = useContext(CartContext);

    return (
        <>
            <Header>
                <HeaderLinks>
                    <Link to="/products/main" ><HeaderP>Home</HeaderP></Link>
                    <Link to="/products/cart" ><HeaderP>Cart Items: {productCart?.length}</HeaderP></Link>
                    <Link to="/products/checkout" ><HeaderP>Checkout</HeaderP></Link>
                </HeaderLinks>

            </Header>
            <Outlet />
        </>

    )
}

export default AppHeader;
